    private void jButton7MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton7MouseClicked
        String nombre = t_nombrehospitales.getText();
        String direccion = a_Direccion.getText();
        int maxparamedicos = (int) Sp_paramedicos.getValue();
        int maxambulancias = (int) Sp_ambulancias.getValue();
        char ranking = (char) Cb_rankingHospitales.getSelectedItem().toString().charAt(0);
        int cont = 0;
        for (Object Arraycomplejo : Arraycomplejos) {
            if (((ComplejosHospitalarios) Arraycomplejo).getNombreComlejo().equals(nombre)) {
                cont++;
            }
        }
        if (cont == 0) {
            if (ranking == 'A') {
                ComplejosHospitalarios temp=new ComplejosHospitalarios(nombre, direccion, maxparamedicos, maxambulancias, Ranking.A);
                Arraycomplejos.add(temp);
            } else if (ranking == 'B') {
                ComplejosHospitalarios temp=new ComplejosHospitalarios(nombre, direccion, maxparamedicos, maxambulancias, Ranking.B);
                Arraycomplejos.add(temp);
            } else if (ranking == 'C') {
                ComplejosHospitalarios temp=new ComplejosHospitalarios(nombre, direccion, maxparamedicos, maxambulancias, Ranking.C);
                Arraycomplejos.add(temp);
            } else {
                ComplejosHospitalarios temp=new ComplejosHospitalarios(nombre, direccion, maxparamedicos, maxambulancias, Ranking.D);
                Arraycomplejos.add(temp);
            }
            JOptionPane.showMessageDialog(this.Complejos, "Se ha guardado exitosamente");
            t_nombrehospitales.setText("");
            a_Direccion.setText("");
            Sp_paramedicos.setValue(0);
            Sp_ambulancias.setValue(0);
        } else {
            JOptionPane.showMessageDialog(Complejos, "Ya existe este Complejo Hospitalario");
        }
    }//GEN-LAST:event_jButton7MouseClicked

