    private void jButton9MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton9MouseClicked
        String nombre = t_nombreParamedico.getText();
        int edad = (int) Sp_edad.getValue();
        String id = t_id.getText();
        char ranking = (char) Cb_rankingParamedicos.getSelectedItem().toString().charAt(0);
        int cont = 0;
        int index = Cb_hospitales.getSelectedIndex();
        String complejo = Cb_hospitales.getSelectedItem().toString();
        int limite = 0;
        int sizearray = 0;
        for (int i = 0; i < Arraycomplejos.size(); i++) {
            if (((ComplejosHospitalarios) Arraycomplejos.get(i)).getNombreComlejo().equals(complejo)) {
                limite = ((ComplejosHospitalarios) Arraycomplejos.get(i)).getMaxParamedicos();
                sizearray = ((ComplejosHospitalarios) Arraycomplejos.get(i)).getParamedicos().size();
            }
        }
        for (Object Arrayparamedico : Arrayparamedicos) {
            if (((Paramedicos) Arrayparamedico).getID().equals(id)) {
                cont++;
            }
        }
        if (sizearray < limite) {
            if (cont == 0) {
                if (ranking == 'A') {
                    Paramedicos temp = new Paramedicos(nombre, edad, id, Ranking.A, complejo);
                    Arrayparamedicos.add(temp);
                    ((ComplejosHospitalarios) Arraycomplejos.get(index)).getParamedicos().add(temp);
                } else if (ranking == 'B') {
                    Paramedicos temp = new Paramedicos(nombre, edad, id, Ranking.B, complejo);
                    Arrayparamedicos.add(temp);
                    ((ComplejosHospitalarios) Arraycomplejos.get(index)).getParamedicos().add(temp);
                } else if (ranking == 'C') {
                    Paramedicos temp = new Paramedicos(nombre, edad, id, Ranking.C, complejo);
                    Arrayparamedicos.add(temp);
                    ((ComplejosHospitalarios) Arraycomplejos.get(index)).getParamedicos().add(temp);
                } else {
                    Paramedicos temp = new Paramedicos(nombre, edad, id, Ranking.D, complejo);
                    Arrayparamedicos.add(temp);
                    ((ComplejosHospitalarios) Arraycomplejos.get(index)).getParamedicos().add(temp);
                }
                JOptionPane.showMessageDialog(Paramedicos, "Se ha guardado exitosamente");
                t_nombreParamedico.setText("");
                t_id.setText("");
                Sp_edad.setValue(0);
            } else {
                JOptionPane.showMessageDialog(Paramedicos, "Ya existe este Paramedico");
            }
        } else {
            JOptionPane.showMessageDialog(Paramedicos, "Ya no se pueden agregar mas paramedicos al Complejo Hospitalario seleccionado");
        }
    }//GEN-LAST:event_jButton9MouseClicked

    private void jButton11MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton11MouseClicked
        try {
            String placa = t_placa.getText();
            int ano = Integer.parseInt(t_ano.getText());
            int velocidad = Integer.parseInt(t_velocidad.getText());
            int cont = 0;
            int index = Cb_ambulancias.getSelectedIndex();
            String complejo = Cb_ambulancias.getSelectedItem().toString();
            for (Object ArrayAmbulancia : Arrayambulancias) {
                if (((Ambulancia) ArrayAmbulancia).getNumeroPlaca().equals(placa)) {
                    cont++;
                }
            }
            int limite = 0;
            int sizearray = 0;
            for (int i = 0; i < Arraycomplejos.size(); i++) {
                if (((ComplejosHospitalarios) Arraycomplejos.get(i)).getNombreComlejo().equals(complejo)) {
                    limite = ((ComplejosHospitalarios) Arraycomplejos.get(i)).getMaxAmbulancias();
                    sizearray = ((ComplejosHospitalarios) Arraycomplejos.get(i)).getAmbulancias().size();
                }
            }
            if (sizearray < limite) {
                if (cont == 0) {
                    Ambulancia temp = new Ambulancia(placa, ano, velocidad, complejo);
                    Arrayambulancias.add(temp);
                    ((ComplejosHospitalarios) Arraycomplejos.get(index)).getAmbulancias().add(temp);
                    JOptionPane.showMessageDialog(Ambulancias, "Se ha guardado exitosamente");
                    t_placa.setText("");
                    t_ano.setText("");
                    t_velocidad.setText("");
                } else {
                    JOptionPane.showMessageDialog(Ambulancias, "Ya existe esta ambulancia");
                }
            } else {
                JOptionPane.showMessageDialog(Ambulancias, "Ya no se pueden agregar mas ambulancias al Complejo Hospitalario seleccionado");
            }
        } catch (Exception e) {
            JOptionPane.showMessageDialog(Ambulancias, "Algun dato ingresado erroneamente");
        }
    }//GEN-LAST:event_jButton11MouseClicked

