    private void EliminarActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_EliminarActionPerformed
        int seleccion = Tabla_ambulancias.getSelectedRow();
        Ambulancia temp = ((Ambulancia) Arrayambulancias.get(seleccion));
        if (seleccion != -1) {
            for (int i = 0; i < Arraycomplejos.size(); i++) {
                if (((ComplejosHospitalarios) Arraycomplejos.get(i)).getNombreComlejo().equals(temp.getComplejoHospitalario())) {
                    for (int j = 0; j < ((ComplejosHospitalarios) Arraycomplejos.get(i)).getAmbulancias().size(); j++) {
                        if (((ComplejosHospitalarios) Arraycomplejos.get(i)).getAmbulancias().get(j).getNumeroPlaca().equals(temp.getNumeroPlaca())) {
                            ((ComplejosHospitalarios) Arraycomplejos.get(i)).getAmbulancias().remove(j);
                        }
                    }
                }
            }
            Arrayambulancias.remove(seleccion);
        } else {
            JOptionPane.showMessageDialog(ComplejosListar, "No ha seleccionado bien");
        }
        DefaultTableModel modelo = (DefaultTableModel) Tabla_ambulancias.getModel();
        while (modelo.getRowCount() > 0) {
            modelo.removeRow(0);
        }
        for (int i = 0; i < Arrayambulancias.size(); i++) {
            String[] arr = new String[4];
            Ambulancia temp1 = (Ambulancia) Arrayambulancias.get(i);
            arr[0] = temp1.getNumeroPlaca();
            arr[1] = Integer.toString(temp1.getYear());
            arr[2] = Integer.toString(temp1.getVelocidad());
            arr[3] = temp1.getComplejoHospitalario();
            modelo.addRow(arr);
        }
        Tabla_ambulancias.setModel(modelo);
    }//GEN-LAST:event_EliminarActionPerformed

    private void jButton10MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton10MouseClicked
        DefaultComboBoxModel modelo = new DefaultComboBoxModel();
        for (int i = 0; i < Arraycomplejos.size(); i++) {
            modelo.addElement(((ComplejosHospitalarios) Arraycomplejos.get(i)).getNombreComlejo());
        }
        cb_reComplejos1.setModel(modelo);
        cb_reComplejos2.setModel(modelo);
        DefaultComboBoxModel modelo1 = new DefaultComboBoxModel();
        for (int i = 0; i < Arrayparamedicos.size(); i++) {
            modelo1.addElement(((Paramedicos) Arrayparamedicos.get(i)).getNombreParamedico());
        }
        cb_reParamedicos.setModel(modelo1);
        DefaultComboBoxModel modelo2 = new DefaultComboBoxModel();
        for (int i = 0; i < Arrayambulancias.size(); i++) {
            modelo2.addElement(((Ambulancia) Arrayambulancias.get(i)).getNumeroPlaca());
        }
        cb_reAmbulancias.setModel(modelo2);
        Reasignacion.setModal(true);
        Reasignacion.pack();
        Reasignacion.setLocationRelativeTo(this);
        Administracion.setVisible(false);
        Reasignacion.setVisible(true);
        while (Reasignacion.isActive() == true) {
            Administracion.setVisible(true);
        }
    }//GEN-LAST:event_jButton10MouseClicked

    private void jButton13MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton13MouseClicked
        String complejo = cb_reComplejos1.getSelectedItem().toString();
        String medico = cb_reParamedicos.getSelectedItem().toString();
        for (int i = 0; i < Arrayparamedicos.size(); i++) {
            if (((Paramedicos)Arrayparamedicos.get(i)).getNombreParamedico().equals(medico)) {
                ((Paramedicos)Arrayparamedicos.get(i)).setComplejoHospitalario(complejo);
            }
        }
        for (int i = 0; i < Arraycomplejos.size(); i++) {
            PriorityQueue<Paramedicos> temp=new PriorityQueue();
            for (int j = 0; j < Arrayparamedicos.size(); j++) {
                if (((ComplejosHospitalarios)Arraycomplejos.get(i)).getNombreComlejo().equals(((Paramedicos)Arrayparamedicos.get(j)).getComplejoHospitalario())) {
                    temp.add((Paramedicos)Arrayparamedicos.get(j));
                }
            }
            ((ComplejosHospitalarios)Arraycomplejos.get(i)).setParamedicos(temp);
        }
        JOptionPane.showMessageDialog(Reasignacion, "Se ha efectuado el cambio exitosamente");        
    }//GEN-LAST:event_jButton13MouseClicked

    private void jButton14MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton14MouseClicked
        String complejo = cb_reComplejos2.getSelectedItem().toString();
        String placa = cb_reAmbulancias.getSelectedItem().toString();
        for (int i = 0; i < Arrayambulancias.size(); i++) {
            if (((Ambulancia)Arrayambulancias.get(i)).getNumeroPlaca().equals(placa)) {
                ((Ambulancia)Arrayambulancias.get(i)).setComplejoHospitalario(complejo);
            }
        }
        for (int i = 0; i < Arraycomplejos.size(); i++) {
            ArrayList<Ambulancia> temp= new ArrayList();
            for (int j = 0; j < Arrayambulancias.size(); j++) {
                if (((ComplejosHospitalarios)Arraycomplejos.get(i)).getNombreComlejo().equals(((Ambulancia)Arrayambulancias.get(j)).getComplejoHospitalario())) {
                    temp.add((Ambulancia)Arrayambulancias.get(j));
                }
            }
            ((ComplejosHospitalarios)Arraycomplejos.get(i)).setAmbulancias(temp);
        }
        JOptionPane.showMessageDialog(Reasignacion, "Se ha efectuado el cambio exitosamente");
    }//GEN-LAST:event_jButton14MouseClicked

